import Dashboard from "views/Dashboard.jsx";


const routes = [
  {
    path: "/home",
    name: "Home",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-bank",
    component: Dashboard,
    layout: "/NUI"
  },
  {
    path: "/research",
    name: "Home",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-bank",
    component: Dashboard,
    layout: "/NUI"
  },
  {
    path: "/nuis",
    name: "Natural UI's",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-bank",
    component: Dashboard,
    layout: "/NUI"
  },
  {
    path: "/conclusion",
    name: "Conclusion",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-bank",
    component: Dashboard,
    layout: "/NUI"
  },
  {
    path: "/sources",
    name: "Sources",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-bank",
    component: Dashboard,
    layout: "/NUI"
  },
];

export default routes;
